import React from 'react';
import styles from './Modal.module.css';

const Modal = ({ children }) => {
    return (
        <div className={ [styles.modal, styles.active].join(' ') }>
            <div className={ styles.modalContent }>
                { children }
            </div>
        </div>
    );
};

export default Modal;
